import React from 'react';
import { AboutContanier } from '../Aboutpage/About.elements';
import { 
    ContactWrap, 
    GetInTouchWrap, 
    GetInTouchHeading,
    GetInTouchText,
    QuickLinkIconWrap,
    QuickLinkWrap,
    QuickLinkIcon } from './Contact.elements';

import Instagram from '../../assets/images/';
import Facebook from '../../assets/images/facebook.png';

const Contact = () => {
    return(
        <AboutContanier>
            <ContactWrap>
                <GetInTouchWrap>
                    <GetInTouchHeading>Get In Touch</GetInTouchHeading>
                    <GetInTouchText>Got a question or query? Weâ€™d love to chat with you about it! You can say hi and get in touch with our carelines teams using the details below.</GetInTouchText>
                    <QuickLinkWrap>
                        <QuickLinkIconWrap>
                            <QuickLinkIcon src={Instagram} />
                        </QuickLinkIconWrap>
                        <QuickLinkIcon src={Facebook} />
                    </QuickLinkWrap>
                </GetInTouchWrap>
            </ContactWrap>
        </AboutContanier>
    )
}

export default Contact;
